function Tab( { entries }) {
    return (
        <div className="tab">
            {
              Object.keys(entries).map( title => {
                return ( 
                <div key={title} className="tab__entry">
                    <button>{title}</button>
                    <div>{entries[title]}</div>
                </div> 
                );
              })
            }   
        </div>
    );
}

export default Tab;
